// importing various folders/libraries to use here
import React, {Component} from "react";
import "./bAndA.css";
import Before1 from "../../assets/before1.png";
import After1 from "../../assets/after1.png";


class BAndA1 extends Component {
  render() {
  return (
    <div className="wrapper">
    <section className="grid">

      <div className="gridArea1">
        <div className="before1"
        style={{ backgroundImage: `url(${Before1})` }}>
          <p className="textBefore1">Before</p>
          <p className="textWord1"> Design</p>
        </div>

        <div className="after1"
        style={{ backgroundImage: `url(${After1})` }}>
       <p className="textAfter1">After</p>
        </div>
      </div>

    </section>
    </div>
  );
}
}

export default BAndA1;
